import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import logo from "./react-logo.png"; // I am using this img

function MainContent() {
  return (
    <div>
      <nav>
        <img className="m-2" src={logo} alt="React Logo" width="60px" />
      </nav>
      <h1 className="text-4xl font-bold underline m-2">
        Fun facts about React
      </h1>
      <ul className="list-disc list-inside text-2xl m-2">
        <li>Was first released in 2013</li>
        <li>Was originally created by Jordan Walke</li>
        <li>Has well over 100k stars on GitHub</li>
        <li>Is maintained by Facebook</li>
        <li>Powers thousands of enterprise apps, including mobile apps</li>
      </ul>
      <footer className="text-right">
        @ 20xx Bonea Adrian development. All rights reserved.
      </footer>
    </div>
  );
}

ReactDOM.render(<MainContent />, document.getElementById("root"));
